import "./App.css";
import axios from "axios";
import { useEffect } from "react";
//useEffect hook allows you to create variables that can hold data and be updated over time
import { useState } from "react";
function App() {
//listOfPosts is var that holds the current value of the state,starts as an empty array'['
  const [listOfPosts, setListOfPosts] = useState([]); 
  useEffect(() => {
    //Running the logic we want to pass after refreshing
    //using axios to run a getRequest that you can see in insomnia
    axios.get("http://localhost:3001/posts").then((res) => console.log(res));
  }, []);
  return <div className="App"></div>;
}
export default App;
